import React , {Component} from 'react';
import Component1 from './nested component';
class App extends Component{

  //arrow function

  myfun = ()=>
  {
    Console.log("hello from arrow function");
  }
  render(){
    return(
      <div className="App">
         <Component1/>
         {this.myfun()}/*to call arrow function*/ 
      </div>
    );
  }
}

export default App;
